import check from './SupportThreeCheck.js'
import errorHandler from '../errorHandler.js'

export default class{
    constructor(){
        try{
            let canvas = document.querySelector("#canvas");
            if(check(canvas)){
                errorHandler('', '', '', "canvas")
            }
        }
        catch(e){
            console.log("biba");
        }
    }
}
